import React, { useEffect, useState } from "react";

const homee = () => {
  const [bool, setBool] = useState(true);

  let toggolBtn = () => {
    setBool(!bool);
    bool === true ? console.log("On") : console.log("Off");
  };

  return (
    <>
      <button onClick={toggolBtn}>Click</button>
    </>
  );
};

export default homee;
